export function sweep() {
    var more = [];
    const thresh = 2;
    var count = 0;
    for (let i = 0; i < data.length; i++) {
        if (more.includes(data[i])) {
             continue;   
        }
        count = 0
        for (let j = i + 1; j < data.length; j++) {
            if (data[i] == data[j]) {
                count++
                if (count > thresh) {
                    more.push(data[i]);
                    break;
                }
            }
        }
    }
    console.log(more);
}